using WashMachine.Forms.Common.UI;
using WashMachine.Forms.Modules.Login;
using WashMachine.Forms.Modules.PaidBy;
using WashMachine.Forms.Modules.Payment.Machine;
using Newtonsoft.Json;
using System;
using System.Collections.Generic;
using System.ComponentModel;
using System.Diagnostics;
using System.Drawing;
using System.Linq;
using System.Threading.Tasks;
using System.Windows.Forms;

namespace WashMachine.Forms.Modules.Payment.PaymentItems
{
    public class Hkd50PaymentItem : IPaymentItem
    {
        readonly MachineService machineService;

        [DisplayName("Hex: 13 88, Hex Command: 88 13")]
        public float Amount => 5000;

        [DisplayName("Hex: 00 0A, Hex Command: 0A 00")]
        public int CoinExchange => 10;

        public List<string> HexCommandsDefault { get; set; }
        public List<string> HexCommandsExpected { get; set; } = new List<string>()
        {
            "0x0E", "0x01", "0xD1", "0x02", "0x00", "0x00", "0x00", "0x00", "0x00", "0x00", "0x88", "0x13", "0x0A", "0x00"
        };

        public int PaymentAmount => 50;

        public Action<bool, string> DropCoinCompleted;

        ProgressUI progressUI;
        Form mainForm;

        public Hkd50PaymentItem(Form parent = null)
        {
            mainForm = parent;
            machineService = new MachineService();
            progressUI = new ProgressUI();
            progressUI.SetParent(parent);
            //Convert Value Hex Command for Amount
            string[] amountHexValue = machineService.ConvertNumberHexToCommand((int)Amount);

            //Convert Value Hex Command for Coin Exchange
            string[] coinExChangeHexValue = machineService.ConvertNumberHexToCommand(CoinExchange);

            HexCommandsDefault = new List<string>
            {
                "0x0E",// 0
                "0x01",// 1
                "0xD1",// 2
                "0x02",// 3
                "0x00",// 4
                "0x00",// 5
                "0x00",// 6
                "0x00",// 7
                "0x00",// 8
                "0x00",// 9
                $"0x{amountHexValue[0]}",// 10
                $"0x{amountHexValue[1]}",// 11
                $"0x{coinExChangeHexValue[0]}",// 12
                $"0x{coinExChangeHexValue[1]}",// 13
            };

            string hexCommandDataExpected = string.Join(string.Empty, HexCommandsExpected);
            string hexCommandDataDefault = string.Join(string.Empty, HexCommandsDefault);

            if (hexCommandDataExpected.Equals(hexCommandDataDefault, StringComparison.OrdinalIgnoreCase))
            {
                Debug.WriteLine("OK");
            }
            else
            {
                Logger.Log("Can't Compute Hex Command Default");
                throw new Exception(nameof(Hkd50PaymentItem));
            }
        }

        public async Task DropCoinAsync(int orderId)
        {
            try
            {
                await Task.Run(async () =>
                {
                    System.Threading.Thread.Sleep(3000);
                    int counter = orderId;
                    Logger.Log($"{nameof(Hkd50PaymentItem)} Step 1 START");
                    List<string> commands = HexCommandsDefault.Select(s => s).ToList();
                    Logger.Log($"{nameof(Hkd50PaymentItem)} Step 2");
                    List<string> hexCommands = machineService.CreateNewHexCommandByCounter(counter, commands);
                    Logger.Log($"{nameof(Hkd50PaymentItem)} Step 3");
                    List<int> xorHexCommands = machineService.XorHexCommand(hexCommands);

                    if (xorHexCommands.Count > 0)
                    {
                        Logger.Log($"{nameof(Hkd50PaymentItem)} Step 4");
                        string lastXor = xorHexCommands.LastOrDefault().ToString("X2");
                        hexCommands.Add($"0x{lastXor}");
                        Logger.Log($"{nameof(Hkd50PaymentItem)} Step 5");
                        IEnumerable<string> xors = hexCommands.Skip(1).Take(hexCommands.Count - 1).Select(s => Convert.ToInt32(s, 16).ToString("X2"));
                        Logger.Log($"{nameof(Hkd50PaymentItem)} Step 6");
                        string xorFormat = $"AA 0E {string.Join(" ", xors)} DD";
                        Logger.Log($"{nameof(Hkd50PaymentItem)} Step 7 XOR: {xorFormat}");
                        AppConfigModel appConfig = Program.AppConfig;
                        Logger.Log($"{nameof(Hkd50PaymentItem)} Step 8 {JsonConvert.SerializeObject(appConfig)}");
                        bool isConnected = await machineService.ConnectAsync(appConfig.DollarCom, appConfig.DollarBaudRate, appConfig.DollarData, appConfig.DollarParity, appConfig.DollarStopBits);
                        Logger.Log($"{nameof(Hkd50PaymentItem)} Step 9");
                        if (isConnected)
                        {
                            Logger.Log($"{nameof(Hkd50PaymentItem)} Step 10");
                            if (Program.AppConfig.XorMethod == 1)
                            {
                                machineService.ExecHexCommand(xorFormat);
                            }
                            else
                            {
                                machineService.ExecCommand(xorFormat);
                            }
                            Logger.Log($"{nameof(Hkd50PaymentItem)} Step 11");
                            machineService.Disconect();
                            Logger.Log($"{nameof(Hkd50PaymentItem)} Step 12 END");
                            DropCoinCompleted?.Invoke(true, "Successfully!.");
                        }
                        else
                        {
                            Logger.Log($"{nameof(Hkd50PaymentItem)} Can not connect device.");
                            DropCoinCompleted?.Invoke(false, $"Can not connect device.! \n Info: XOR COMMAND: {xorFormat} \n CONFIG: {JsonConvert.SerializeObject(appConfig)}");
                        }
                    }
                    else
                    {
                        Logger.Log(nameof(Hkd50PaymentItem) + " DropCoinAsync xorHexCommands is empty");
                        DropCoinCompleted?.Invoke(false, "Can not do XOR Hex Command");
                    }
                });
            }
            catch (Exception ex)
            {
                Logger.Log(ex);
                DropCoinCompleted?.Invoke(false, ex.Message);
            }
        }

        public Control GetTemplate()
        {
            CardItemProperty cardItem = new CardItemProperty()
            {
                Title = "HKD 50",
                BackgroundColor = "#92d050",
                TitleColor = "#ffffff",
                CoverImageBase64 = ""
            };

            CardButtonRoundedUI cardButton = new CardButtonRoundedUI()
            {
                Dock = DockStyle.Fill,
                Padding = new Padding(10),
                Height = 50,
                Width = 170,
                ShapeBackgroudColor = ColorTranslator.FromHtml(cardItem.BackgroundColor),
                ShapeBorderColor = Color.Black,
                CornerRadius = 50
            };
            cardButton.Click += CardItem_Click;

            TableLayoutPanel tblCardItem = new TableLayoutPanel()
            {
                Dock = DockStyle.Fill,
                BackColor = ColorTranslator.FromHtml(cardItem.BackgroundColor),
                Enabled = false
            };

            tblCardItem.RowStyles.Add(new RowStyle() { Height = 100, SizeType = SizeType.Absolute });
            tblCardItem.RowStyles.Add(new RowStyle() { Height = 150, SizeType = SizeType.Absolute });
            tblCardItem.ColumnStyles.Add(new ColumnStyle() { Width = 100, SizeType = SizeType.Percent });

            Panel pnCover = new Panel
            {
                BackgroundImage = cardItem.GetCoverImage(),
                BackgroundImageLayout = ImageLayout.Stretch,
                Dock = DockStyle.Fill,
                Enabled = false
            };
            tblCardItem.Controls.Add(pnCover, 0, 0);

            Label lbTitle = new Label
            {
                Text = cardItem.Title,
                Font = new Font(tblCardItem.Font.FontFamily, 17, FontStyle.Regular),
                ForeColor = ColorTranslator.FromHtml(cardItem.TitleColor),
                TextAlign = ContentAlignment.MiddleCenter,
                Dock = DockStyle.Fill,
                Enabled = false
            };
            tblCardItem.Controls.Add(lbTitle, 0, 1);
            cardButton.Controls.Add(tblCardItem);

            return cardButton;
        }

        public Task PaymentAsync()
        {
            throw new NotImplementedException();
        }

        private async void CardItem_Click(object sender, EventArgs e)
        {
            await ClickAsync();
        }

        public async Task ClickAsync()
        {
            PaymentForm paymentForm = (PaymentForm)mainForm;
            if (paymentForm.FollowType == Login.FollowType.TestMachineWithoutPayment)
            {
                progressUI.Show();
                await DropCoinAsync(Program.Counter);
                progressUI.Hide();
            }
            else
            {
                PaidByForm paidByForm = new PaidByForm(paymentForm.FollowType, this);
                paidByForm.Show();
                paidByForm.FormClosed += PaidByForm_FormClosed;
                paymentForm.Hide();
            }
        }

        private void PaidByForm_FormClosed(object sender, FormClosedEventArgs e)
        {
            PaymentForm paymentForm = (PaymentForm)mainForm;
            paymentForm.Close();
        }
    }
}
